### Summary of Core Topics and Concepts

#### Linear Algebra
1. **Linear Independence and Dependence**
   - Definition and properties of linearly independent and dependent vectors.
   - Example: \( v_1, v_2, v_3 \) being linearly independent vectors in \( \mathbb{R}^3 \).

2. **Matrix Operations and Properties**
   - Matrix addition, scalar multiplication, and determinant.
   - Conditions for matrix operations (e.g., determinant is valid only for square matrices).
   - Example: \( A \) being an \( m \times n \) matrix, operations valid only when \( m = n \).

3. **Rank of a Matrix**
   - Definition and calculation of rank.
   - Example: Finding the rank of matrices \( A \) and \( B \).

4. **System of Linear Equations**
   - Conditions for no solution, unique solution, and infinitely many solutions.
   - Example: System \( Ax = b \) with different conditions on \( k \).

5. **Subspaces and Basis**
   - Definition and properties of subspaces.
   - Finding a basis for a subspace.
   - Example: Subspaces \( W_1 \) and \( W_2 \) of \( M_{2 \times 2}(\mathbb{R}) \).

6. **Determinants and Invertibility**
   - Conditions for a matrix to be invertible.
   - Calculation of determinants.
   - Example: Determinant of matrices \( A \) and \( B \).

7. **Intersection and Union of Subspaces**
   - Definition and properties of intersection and union of subspaces.
   - Example: \( W_1 \cap W_2 \) and \( W_1 \cup W_2 \).

### Equations and Principles

1. **Linear Independence**
   - Vectors \( v_1, v_2, v_3 \) are linearly independent if \( c_1v_1 + c_2v_2 + c_3v_3 = 0 \) implies \( c_1 = c_2 = c_3 = 0 \).

2. **Matrix Operations**
   - \( A + A \) is valid for any matrix \( A \).
   - \( \det(A) \) is valid only if \( A \) is a square matrix.
   - \( cA \) is valid for any scalar \( c \) and matrix \( A \).

3. **Rank of a Matrix**
   - \( \text{rank}(A) \) is the dimension of the column space or row space of \( A \).

4. **System of Linear Equations**
   - For \( Ax = b \), if \( \det(A) \neq 0 \), there is a unique solution.
   - If \( \det(A) = 0 \) and \( b \) is not in the column space of \( A \), there is no solution.

5. **Subspaces and Basis**
   - A basis for a subspace \( W \) is a set of linearly independent vectors that span \( W \).
   - Example: Basis for \( W_1 \) and \( W_2 \).

6. **Determinants and Invertibility**
   - A matrix \( A \) is invertible if \( \det(A) \neq 0 \).
   - \( \det(AB) = \det(A)\det(B) \).

7. **Intersection and Union of Subspaces**
   - \( W_1 \cap W_2 \) is the set of vectors in both \( W_1 \) and \( W_2 \).
   - \( W_1 \cup W_2 \) is the set of vectors in either \( W_1 \) or \( W_2 \).

